export default class HtmlLogger {
    constructor(options: any, parent?: HTMLElement);
    options: any;
    parent: HTMLElement;
    linesCount: number;
    $: {};
    initialized: boolean;
    init(): void;
    setLevel(level: any): void;
    setEnable(enable?: boolean): void;
    /**
     * Removes all lines from the view
     * @memberOf HtmlLogger
     */
    clean(): void;
    /**
     * prints message. default level is [info].
     * @param {String} msg - message to print
     * @param {String} [hexColor=levels.info.color] - hexcolor text
     * @param {String} [level=levels.info.name] - level suffix
     *
     * @memberOf HtmlLogger
     */
    print(msg: string, hexColor?: string, level?: string): void;
    info(...args: any[]): void;
    debug(...args: any[]): void;
    warning(...args: any[]): void;
    success(...args: any[]): void;
    error(...args: any[]): void;
    _getTime(): string;
    _determineString(object: any): any;
}
